                "attributedDescription": {
                  "content": "Official Alice Deejay Channel - Watch the Official Music Video of Better Off Alone The Ultimate 90s Eurodance Hit. Subscribe for more Alice Deejay!\nLyrics listed below.\n\nWe are touring around the world. Catch us live, check out the schedule: https://alicedeejay.com\n\nListen on Spotify: https://open.spotify.com/track/5XVjNR...\n\nFollow me online:\nTikTok: /alicedj\nInstagram: /alicedj\nFacebook: http://www.fb.com/AliceDeejay\nTwitter: /alicedj\n\nBack in 1999, a group of young Dutch DJs and talented producers collaborated with frontwoman Judy to form Alice Deejay. Alice Deejays album 'Who Needs Guitars Anyway?' featured no less than 5 international hits, sold over 1 million albums and 5 million singles and crushed the charts in Germany, France, South Africa, Australia, Sweden, Norway, Denmark, Belgium, The Netherlands, Spain, Portugal and Canada - just to name a few. Back in the 90s, you could hear lead singles Better Off Alone, Will I Ever and Back In My Life riding the airwaves non-stop. \n\nNot to mention the influence Alice Deejay has had on dance music; many great artists such as David Guetta and Akon, Whiz Khalifa, Farruko, Sam Feldt x Jonas Blue and now megastars Kim Petras & Nicki Minaj scored hits using the hook of Better off Alone.\n\nThe music video was shot in Miami and features Alice DJ - Judith Pronk, MIla and Angelique - in the iconic colourful setting. The video was partially directed by Cousin Mike with the 1711 Production Group. The video also consists of desert scenes from the original video dubbed UK edit, directed by Olaf van Gerwen with Blood Simple. \n\nCheck out the UK edit video here: AliceDeejay-BetterOffAlone(UKE...\n\nLyrics: Better Off Alone\n\nDo you think you're better off alone\nDo you think you're better off alone\nDo you think you're better off alone\nDo you think you're better off alone\n\nTalk to me \nOoooooh talk to me \nTalk to me \nOoooooh talk to me\n\nDo you think you're better off alone\nDo 